uniform float iTime;
uniform vec2 iResolution;
uniform vec4 iMouse;
uniform sampler2D iChannel0;

// User parameters
uniform float u_speed;
uniform float u_bloom;
uniform float u_grain;
uniform float u_flicker;
uniform float u_vignette;
uniform float u_red_intensity;

out vec4 fragColor;

// Rotation matrix
mat2 rot(float a) {
    float s = sin(a), c = cos(a);
    return mat2(c, -s, s, c);
}

// Pseudo-random noise
float hash(vec2 p) {
    return fract(sin(dot(p, vec2(12.9898, 78.233))) * 43758.5453);
}

// Signed Distance Function for a Rounded Box (used for the bars)
float sdBox(vec2 p, vec2 b) {
    vec2 d = abs(p) - b;
    return length(max(d, 0.0)) + min(max(d.x, d.y), 0.0);
}

// Simple procedural font approximation for the "Stranger Things" serif look
// Focusing on the iconic red outlines and floating bars
float logoSDF(vec2 p, float time) {
    float d = 1e10;

    // Horizontal Top Bar (Iconic "Stranger" top line)
    float barTop = sdBox(p - vec2(0.0, 0.45), vec2(0.7, 0.012));
    d = min(d, barTop);

    // Vertical side bars
    float barLeft = sdBox(p - vec2(-0.7, 0.25), vec2(0.012, 0.22));
    float barRight = sdBox(p - vec2(0.7, 0.25), vec2(0.012, 0.22));
    d = min(d, barLeft);
    d = min(d, barRight);

    // Floating text-like geometric shapes to simulate the "STRANGER" text blocks
    // This is a stylized representation focusing on the aesthetic composition
    for(int i=0; i<8; i++) {
        float fi = float(i);
        float x_pos = -0.6 + fi * 0.17;
        float y_off = sin(time * 0.2 + fi) * 0.01;
        float charBox = sdBox(p - vec2(x_pos, 0.25 + y_off), vec2(0.05, 0.12));
        d = min(d, charBox);
    }

    // "THINGS" bottom row representation
    for(int i=0; i<6; i++) {
        float fi = float(i);
        float x_pos = -0.45 + fi * 0.18;
        float y_off = cos(time * 0.3 + fi) * 0.005;
        float charBox = sdBox(p - vec2(x_pos, -0.1 + y_off), vec2(0.06, 0.15));
        d = min(d, charBox);
    }

    return d;
}

void main() {
    // Correct Aspect Ratio UVs
    vec2 uv = (gl_FragCoord.xy - 0.5 * iResolution.xy) / iResolution.y;
    vec2 raw_uv = gl_FragCoord.xy / iResolution.xy;

    float t = iTime * u_speed;

    // Subtle camera drift
    uv += vec2(sin(t * 0.1), cos(t * 0.15)) * 0.02;
    uv *= 1.0 + sin(t * 0.05) * 0.05; // Slight zoom pulse

    // 1. Calculate Logo Distance
    float d = logoSDF(uv, t);

    // 2. Neon Red Glow Effect
    // The "Stranger Things" look is characterized by a thick, slightly blurry red outline
    float thickness = 0.005;
    float edge = smoothstep(thickness, 0.0, abs(d)); // The hard line
    float glow = exp(-abs(d) * 15.0) * 0.6;          // Core glow
    float outerGlow = exp(-abs(d) * 4.0) * 0.3;      // Far glow

    // 3. Flickering Logic
    float flicker = 1.0 - (u_flicker * 0.3 * hash(vec2(floor(t * 15.0), 0.0)));
    flicker *= 1.0 - (u_flicker * 0.15 * sin(t * 50.0));

    // 4. Color Construction (Deep 80s Red)
    vec3 baseRed = vec3(1.0, 0.05, 0.02) * u_red_intensity;
    vec3 col = baseRed * (edge + glow + outerGlow * 0.5);
    col *= u_bloom * flicker;

    // 5. Add "The Upside Down" Particles (Dust/Spores)
    float particles = 0.0;
    for(float i=0.0; i<40.0; i++) {
        float speed = 0.1 + hash(vec2(i, 1.0)) * 0.2;
        vec2 pPos = vec2(
            hash(vec2(i, 2.0)) * 2.0 - 1.0,
            mod(hash(vec2(i, 3.0)) - t * speed, 1.2) - 0.6
        );
        pPos.x += sin(t * 0.5 + i) * 0.1; // Sways
        float pSize = 0.002 + hash(vec2(i, 4.0)) * 0.003;
        particles += smoothstep(pSize, 0.0, length(uv - pPos)) * (0.3 + 0.7 * hash(vec2(i, 5.0)));
    }
    col += particles * vec3(0.8, 0.9, 1.0) * 0.4 * u_bloom; // Cold blue/white dust

    // 6. Volumetric "Mist" or Background haze
    float haze = hash(uv + t * 0.01) * 0.04;
    col += haze * vec3(0.1, 0.0, 0.0);

    // 7. Film Grain
    float grain = (hash(uv + fract(t)) - 0.5) * u_grain;
    col += grain;

    // 8. Vignette
    float vig = length(raw_uv - 0.5);
    vig = smoothstep(0.8, 0.2, vig * u_vignette);
    col *= vig;

    // 9. Retro CRT Color Shift (Slight Chromatic Aberration)
    float chroma = 0.003 * u_bloom;
    float r = col.r;
    float g = texture(iChannel0, raw_uv + vec2(chroma, 0.0)).g * 0.1; // Fake offset
    float b = texture(iChannel0, raw_uv - vec2(chroma, 0.0)).b * 0.1;

    // Final Output
    fragColor = vec4(col, 1.0);
}
